script: |
  super -f text -I q12386.spq | sort > q12386.out

inputs:
  - name: q12386.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE col1 * col2 / - - col2 + + 3 / - + col0 + col0 NOT BETWEEN - col1 AND 41;
  - name: tab1

outputs:
  - name: q12386.out
    data: |
      51	14	96
      85	5	59
      91	47	68
